JOIN tify_channels p ON p.id = sc.parent_id
SET sc.title = CONCAT(p.title,' - ', ELT(((CAST(SUBSTRING_INDEX(sc.reference_code,'-',-1) AS UNSIGNED)-1) % 15)+1,
  'Emergencias','Seguridad','Salud','Transporte','Eventos','Académicos','Comunidad','Clima','Comunicados','Verificación','Alianzas','Operaciones','Logística','Voluntariado','Información'
